import head from 'next/head'

function Home() {
    return (
        <>
        <head>
            <title>My Next.js Site</title>
            <meta name="viewport" content="initial-scale=1.0, width=device-width" />
        </head>
        <div>Welcome to Next.js, Explorer!</div>
        </>
    )  
}

export default Home
